import binascii
import io
from PIL import Image
import numpy as np
import cv2 as cv
from glob import glob

def get_input(data: str):
    data = data.split()
    res = ''
    for d in data:
        if len(d) == 1: res += '0'
        res += d

    res = res.strip()
    res = res.replace(' ', '').replace('\n', '')
    res = binascii.a2b_hex(res)

    find_znak = np.array(Image.open(io.BytesIO(res)).convert('RGB'))[:, :, ::-1].copy()

    find_znak = cv.cvtColor(find_znak, cv.COLOR_BGR2GRAY)
    find_znak = cv.resize(find_znak, (64, 64), interpolation=cv.INTER_AREA)
    return find_znak


