def check(find, base):
    differs = set()
    for x in range(64):
        for y in range(64):
            d = abs(find[x, y] - base[x, y]) / 255
            if d > 0.1:
                differs.add(d)
    print('ddcg')
    print(differs)
    return sum(differs) / len(differs)

def load_znaks():
    znaki = dict()
    for i in glob(r'D:\Programs\PyCharm\Projects\Some_games\Stepic_OpenCv\znaki\*.jpg'):
        name = i[i.rfind(r"znaki") + 6: - 4]
        img = cv.imread(i, cv.IMREAD_COLOR)
        img = cv.resize(img, (64, 64), interpolation=cv.INTER_AREA)
        znaki[name] = img

    im_v = cv.vconcat([znaki[i] for i in znaki])
    im_bts = cv.imencode('.jpg', im_v)[1].tostring()

    return im_bts

print(load_znaks())
